#\Time Taken by function
import time
def decorates(func):
    def wrapper(difficulty,profit,worker):
        inital_time=time.time()
        # print(inital_time)
        print(func(difficulty,profit,worker))
        final_time=time.time()
        print('time:',round(final_time-inital_time,3))
    return wrapper
    
@decorates
def maxProfitAssignment(difficulty, profit, worker) -> int:
        total=0
        jobs = sorted(zip(profit, difficulty),reverse=True)
        #print(jobs)
        for i in worker:
            for p,d in jobs:
                if d<=i:
                    total+=p

                    break
        return total
        
